import "./ExpenseItem.css";

interface props {
  date: Date;
  title: string;
  amount: number;
}
export const ExpenseItem = (props: props) => {
  console.log(`The data received is: ${props}`);
  const month: string = props.date.toLocaleString("en-US", { month: "long" });
  const day: string = props.date.toLocaleString("en-US", { day: "2-digit" });
  const year: number = props.date.getFullYear();

  return (
    <div className="expense-item">
      <div className="">
        <div>{month}</div>
        <div>{day}</div>
        <div>{year}</div>
      </div>
      <div className="expense-item__description">
        <h2>{props.title}</h2>
      </div>
      <div className="expense-item__price">${props.amount}</div>
    </div>
  );
};
